import './ExpenseDate.css'

function ExpenseDate(props){

    const month = props.z.toLocaleString('en-US', { month: 'long' });
    const day = props.z.toLocaleString('en-US', { day: '2-digit' });
    const year = props.z.getFullYear();

    return(
        <div>
                <div>{month}</div>
                <div>{year}</div>
                <div>{day}</div>
            </div>
    );


}
export default ExpenseDate;
